Get value of variable outside API function call<p>I am trying to make a chat application project with abusive text detection. I found code for the chat application online and want to add text detection using <a href="https://developers.perspectiveapi.com/s/docs-sample-requests" rel="nofollow noreferrer">Perspective API</a>. The API has several attributes for toxicity, threat etc. I am able to set the attributes inside the API function but I am unable to access them outside it.</p>
<p>Here is the relevant code:-</p>
<pre><code>  const sendMessage = asyncHandler(async (req, res) =&gt; {
  const { content, chatId } = req.body;

  let toxicity, insult, profanity, threat;

  if (!content || !chatId) {
    console.log(&quot;Invalid data passed into request&quot;);
    return res.sendStatus(400);
  }

  let newMessage = {
    sender: req.user._id,
    content: content,
    chat: chatId,
    toxicity: toxicity,
    insult: insult,
    profanity: profanity,
    threat: threat,
  };

  let inputText = newMessage.content;

  // Perspective API
  google
    .discoverAPI(process.env.DISCOVERY_URL)
    .then((client) =&gt; {
      const analyzeRequest = {
        comment: {
          text: inputText,
        },
        requestedAttributes: {
          TOXICITY: {},
          INSULT: {},
          PROFANITY: {},
          THREAT: {},
        },
      };

      client.comments.analyze(
        {
          key: process.env.API_KEY,
          resource: analyzeRequest,
        },
        (err, response) =&gt; {
          if (err) throw err;
          // console.log(JSON.stringify(response.data, null, 2));
          toxicity = (response.data.attributeScores.TOXICITY.summaryScore.value * 100).toFixed(2);
          insult = (response.data.attributeScores.INSULT.summaryScore.value * 100).toFixed(2);
          profanity = (response.data.attributeScores.PROFANITY.summaryScore.value * 100).toFixed(2);
          threat = (response.data.attributeScores.THREAT.summaryScore.value * 100).toFixed(2);

          newMessage.toxicity = toxicity;
          newMessage.insult = insult;
          newMessage.profanity = profanity;
          newMessage.threat = threat;
          console.log(&quot;1-&quot; + newMessage.toxicity); // This returns the desired output
        }
      );
    })
    .catch((err) =&gt; {
      throw err;
    });
  //

  console.log(&quot;2-&quot; + newMessage.toxicity); // This returns undefined

  try {
    let message = await Message.create(newMessage);

    message = await message.populate(&quot;sender&quot;, &quot;name profilePic&quot;);
    message = await message.populate(&quot;chat&quot;);
    message = await User.populate(message, {
      path: &quot;chat.users&quot;,
      select: &quot;name profilePic email&quot;,
    });

    await Chat.findByIdAndUpdate(req.body.chatId, {
      latestMessage: message,
    });

    res.json(message);
  } catch (error) {
    res.status(400);
    throw new Error(error.message);
  }
});
</code></pre>
<p>I want newMessage to be updated after the API call. After coming across this <a href="https://stackoverflow.com/questions/14220321/how-to-return-the-response-from-an-asynchronous-call">post</a>, I found that <code>console.log(&quot;2-&quot; + newMessage.toxicity)</code> executes before <code>console.log(&quot;1-&quot; + newMessage.toxicity)</code>. I tried using callbacks and async/await but couldn't make it work.</p>

