Vinculate Schemas on MongoDB using Express and mongoose<p>I am trying to link my schemas within my &quot;Movie&quot; entity so that I can have my information both in the &quot;Movie&quot; entity and in the others, they are:</p>
<ul>
<li>Category</li>
<li>Actor</li>
<li>director</li>
<li>Studio</li>
</ul>
<p>for now I'm testing categories</p>
<p>My code is the following:</p>
<p><em>controllers/movie.js</em></p>
<pre><code>
const create = async (req, res) =&gt; {
    const content = req.body;

    const category = await Category.findById(content._id);
    const actor = await Actor.findById(content._id);
    const director = await Director.findById(content._id);
    const studio = await Studio.findById(content._id);

    const newMovie = new Movie({
        ...content,
        category,
        actor,
        director,
        studio
    });

    const savedMovie = await newMovie.save();

    category.movies = [...category.movies, savedMovie._id];
    await category.save();
    actor.movies = [...actor.movies, savedMovie._id];
    await actor.save();
    director.movies = [...director.movies, savedMovie._id];
    await director.save();
    studio.movies = [...studio.movies, savedMovie._id];
    await studio.save();

    res.status(201).json({
        message: 'Movie created successfully',
        movie: savedMovie
    });
};
</code></pre>
