<p>Sorry in advance if this is a very basic question or it has already been asked, but since I do not really know how to ask this, I haven't been able to find any answers at all.</p>
<p>I am currently building a REST API using Node.js with Express.js and Mongoose for accessing the server database. I also have a Swift Wrapper and SwiftUI client for working with this data.</p>
<p>In the API, I have the following model:</p>
<pre><code>const UserSchema = new Schema({
  id: { type: String, required: true },
  email: { type: String, unique: true, required: true, lowercase: true },
  displayName: { type: String, required: true },
  displayImage: { type: String, required: true },
  password: { type: String, required: true, select: false },
  dateCreated: { type: Date, default: Date.now() },
  lastLogin: Date,
  collections: [Collection.schema]
}, { collection: 'Usuarios' })
</code></pre>
<p>Whose equivalent, in Swift, is the following:</p>
<pre><code>public struct User: Codable, Identifiable {

    // MARK: - STORED PROPERTIES

    /// The account's ID as registered by the server.
    // swiftlint:disable:next identifier_name
    public let id: String

    /**
     The account's email.
     */
    public let email: String

    /**
     The account's display name.
     */
    public let displayName: String

    /**
     The account's display image.
     */
    public let displayImage: String

    /**
     The account's password.
     */
    public let password: String?

    /**
     The date the account was created.
     */
    public let dateCreated: String

    /**
     The date of the last login.
     */
    public let lastLogin: String

    /**
     The collections associated with this account.
     */
    public let collections: [Collection]

}

/// Grants us conformance to `Hashable` for _free_
extension User: Hashable {
    public static func == (lhs: User, rhs: User) -&gt; Bool {
        return lhs.id == rhs.id
    }

    public func hash(into hasher: inout Hasher) {
        hasher.combine(id)
    }
}
</code></pre>
<p>Then, I have the following function for retrieving users:</p>
<pre><code>function getUsers (req, res) {
  User.findOne({id: req.userID}, (err, user) =&gt; {
    if (err) return res.status(500).send({message: `An error occurred while doing the petition: ${err}`})
    if (!user) return res.status(404).send({message: `No user with id ${req.userID} could be found.`})

    res.send(200, { user })
  }).select('-_id')
}
</code></pre>
<p>Until here, everything is alright. If I make a post request to a specific endpoint, the <code>getUsers</code> function is run and I am returned the following data:</p>
<pre><code>{
    &quot;user&quot;: {
        &quot;id&quot;: &quot;ecd4e343-4898-4daf-aa2b-dd176011a70c&quot;,
        &quot;email&quot;: &quot;ena.viens@mailtag.com&quot;,
        &quot;displayName&quot;: &quot;Buck&quot;,
        &quot;displayImage&quot;: &quot;image&quot;,
        &quot;dateCreated&quot;: &quot;2022-04-17T22:01:53.960Z&quot;,
        &quot;lastLogin&quot;: &quot;2022-04-17T22:02:13.115Z&quot;,
        &quot;collections&quot;:[],
        &quot;__v&quot;:0
    }
}
</code></pre>
<p>The problem comes when I decode this data into the swift model provided above. Since the API first returns a <code>user</code> dictionary, I cannot decode the data into the model because it throws an error.</p>
<p>How would I make express.js (or mongoose) return directly the data instead of another dict? Is this the correct way to do this, or should I instead change the Swift file where I decode the data so that it expects a dictionary?</p>
<p>Thanks in advance.</p>; Answer: @VadaPoch: The first answer posted often gets a fair (unfair?) number of up-votes, as long as it's at least reasonably good. Such is life on SO.

